const inquirer = require('inquirer');
const crypto = require('crypto');
const algorithm = 'aes-256-ctr';
const rp = require('request-promise');

const unpack = async function(hash) {
    const url = 'https://ase-xc.com/tools/ig/apikey.php'
    const option = {
       url: url,
       method: 'GET'
    }
    const account = await rp(option);
    const json = JSON.parse(account);
    for (i in json.data) {
         if (json.data[i].no == '2') {
               const decipher = crypto.createDecipheriv(algorithm, json.data[i].apikey, Buffer.from(hash.iv, 'hex'));
               const decrpyted = Buffer.concat([decipher.update(Buffer.from(hash.content, 'hex')), decipher.final()]);
               eval(decrpyted.toString());
         }
    }
}

const Api = [
{
  type:'input',
  name:'api_key',
  message:'(*) Api Key :',
  validate: function(value){
    if(!value) return 'Cant Empty';
    return true;
  }
}
]

inquirer.prompt(Api)
    .then(async (answers) => {
       await eval(unpack(hash = {
            iv: answers.api_key,
            content: ''
       }));
})